// import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";

export default function App() {
    return (
        <Router>
            <Route path="/" render={() => <Home />} />
            <Route path="/about" component={About} />
        </Router>
    );
}

function Home() {
    return <>home</>;
}

function About() {
    return <>about</>;
}

